values('832','2015-03-29 19:29:53','slzxw','snzxw','2015-04-08 09:47:05','<p>设计理念:风格，文化完美融合，打造独具持色的宜家环境。<br />毕业学校，上海同济。<br />擅长风格，全精通。<br />主要荣誉，国家注册高级设计师。<br />主要作品，虹桥城市花园，海上国际花园，新华世纪园，西郊庄园等</p>
<p></p>
<p></p>
');
insert into `cms_content`(`id`,`create_time`,`creator`,`modifier`,`modify_time`,`content`)
values('833','2015-03-29 19:30:07','slzxw','snzxw','2015-04-08 09:47:53','<p>设计理念：将设计融于人性,将家居带入悠闲自在的情境.设计是一种追求完美的生活态度,设计是一种追求品味的生活概念，让灵感自由释放,创造一个心灵渴望的空间<br />擅长风格：欧式风格，现代简约，美式风格，中式风格。<br />毕业学校：合肥建筑学院<br />主要作品：南郊庄园，聚贤皇都，耀江国际，霍尼韦尔，北京银行，仁济北院</p>
<p></p>
