insert into `cms_content`(`id`,`create_time`,`creator`,`modifier`,`modify_time`,`content`)
values('905','2015-04-11 18:25:27','admin','snzxw','2015-06-02 16:45:02','<p><span style="line-height: 1.6em;"><strong>在装修中，客厅天花板的设计和风水问题不容忽视。因为客厅是最需要好风水庇佑的地方没关系着家庭成员的运势和健康。那么客厅装修中的天花板有什么风水方面需要注意啦？接下来就让我们一起了解下吧。</strong></span></p>
<p><strong>一：色调</strong></p>
<p><strong>客厅的天花板就好比家中的天，而地板就是地。如果天花板的色调过过重，就容易让家人有种“头重脚轻的”的压顶之感。另外，天花板的颜色过深则不符合“天轻地重”的原则。所以在设计天花板的时候，就该现则色调较轻的颜色，例如天空蓝、白云的白等。而地板是可以用相对较重的色调。</strong></p>
<p><strong><span style="line-height: 1.6em;">二：高度</span></strong></p>
<p><strong>这里针对天花板过矮的情形来处理，因为会给客厅带来横梁压顶的压迫感。如果是天花板的高度过矮，则可以在装修设计的时候，轩辕中间高四边低的造型。这样就能让客厅的高度看起来舒服，而且中间高两边矮看起来就像“天池”一样，风水学中认为此为聚水聚财的格局。所以不妨考虑“天池”的天花板造型，对家宅也大有裨益。合适的话，还能适当的选择水晶吊灯一坐画龙点睛之用。</strong></p>
<p><strong><span style="line-height: 1.6em;">三：吊灯</span></strong></p>
<p><strong>不少家庭都会在客厅安置一盏华丽的吊灯，让整个家宅看起来都高大上了N个层次。而客厅在风水学中主事业，灯光务必要充足明亮。一般来说，吊灯最好就是选择圆形，吸顶灯同样如此。因为圆形有圆滑、圆满的寓意，能够让事业更加和顺，家人关系也倍加和睦。</strong></p>
<p></p>
<p></p>
<p></p>
');
