insert into `park_brand`(`id`,`create_time`,`creator`,`modifier`,`modify_time`,`eng_name`,`introduction`,`logo_path`,`name`,`url`,`logo_image_store`)
values('3','2014-03-31 15:16:10','wxh','wxh','2014-03-31 15:40:54','','为为网是上海最早从事电子商务的企业之一，现在已经拥有5百万的注册会员，日访问量达350万人次，日交易额破千万。2014年初，为为网和勒柯斯签订了入驻协议，租用创智园区3万平米的专业电商仓库。同时，勒柯斯将凭借自身强大的电子商务物流配送能力和现代化的电商仓储管理能力进一步服务为为网，强化其在江苏、浙江地区的辐射能力。届时，为为网将以溧阳为支点，进一步拓宽江浙两省的电商市场，实现传统快递结合仓库模式的现代物流革新。',null,'为为网','','[{"size":26973,"fileName":"5ruzhupinpai-1(1).jpg","absolutePath":"/images/logo/5ruzhupinpai-1(1).jpg","contentType":"image/jpeg","description":"","fileManagerId":"haolue-upload","md5":"dfb55c4c0b4f410d35f7ed3814befbf3","ext":"","createTime":"2014-03-31 15:40:49","modifyTime":"2014-03-31 15:40:49","creator":"wxh","modifier":"wxh"}]');
insert into `park_brand`(`id`,`create_time`,`creator`,`modifier`,`modify_time`,`eng_name`,`introduction`,`logo_path`,`name`,`url`,`logo_image_store`)
values('4','2014-03-31 15:39:32','wxh','wxh','2014-03-31 15:39:32','','中国（上海）自由贸易试验区，于2013年8月22日经国务院正式批准设立。
自贸区依托保税仓库，将传统的仓储物流拓展成为具有采购、批发、零售、模式化运营等更广阔的商品空间，上海自贸区商品直销中心因此诞生。
作为上海自贸区与创智园的重点合作项目，自贸区商品直销中心将在园区内的新时代广场落成，成为溧阳及常州周边消费者购物的地标性高端商城。',null,'上海自贸区商品直销中心','','[{"size":42601,"fileName":"QQjietu20140331153405.jpg","absolutePath":"/images/logo/QQjietu20140331153405.jpg","contentType":"image/jpeg","description":"","fileManagerId":"haolue-upload","md5":"5bd66c387bf5c314f1bac76b6ad11d97","ext":"","createTime":"2014-03-31 15:37:53","modifyTime":"2014-03-31 15:37:53","creator":"wxh","modifier":"wxh"}]');
insert into `park_brand`(`id`,`create_time`,`creator`,`modifier`,`modify_time`,`eng_name`,`introduction`,`logo_path`,`name`,`url`,`logo_image_store`)
values('5','2014-03-31 16:22:54','wxh','wxh','2014-03-31 16:22:54','','一期项目已建成高标准仓储区、港口作业区、大型交易区、信息化大楼和信息化平台系统，总计707亩，投资金额12亿人民币。到2012年10月前，园区内交易额已经突破10亿元人民币。预计2013年将突破50亿元人民币。',null,'江苏苏浙皖物流集团一期项目','','[{"size":50594,"fileName":"tupiansuzhewan1qi.jpg","absolutePath":"/images/logo/tupiansuzhewan1qi.jpg","contentType":"image/jpeg","description":"","fileManagerId":"haolue-upload","md5":"710fe03786c48325c831105a78c53eff","ext":"","createTime":"2014-03-31 16:22:12","modifyTime":"2014-03-31 16:22:12","creator":"wxh","modifier":"wxh"}]');
insert into `park_brand`(`id`,`create_time`,`creator`,`modifier`,`modify_time`,`eng_name`,`introduction`,`logo_path`,`name`,`url`,`logo_image_store`)
values('6','2014-03-31 16:25:55','wxh','wxh','2014-03-31 16:25:55','','经过专业市场调研，结合自身六大功能，二期园区将建设成为大型电子商务集聚平台，以电子商务和物流类企业为主，引入电子商务产业链上下游企业，形成产业的有效聚集，为电子商务企业提供一体化、集成式服务，促进地区产业结构转型、拉动就业、促进区域产业升级。<br />
<br />',null,'江苏苏浙皖物流园集团二期项目','','[{"size":57613,"fileName":"tupiansuzhewanerqi.jpg","absolutePath":"/images/logo/tupiansuzhewanerqi.jpg","contentType":"image/jpeg","description":"","fileManagerId":"haolue-upload","md5":"a33acd71f378e3302a4632d611c01167","ext":"","createTime":"2014-03-31 16:25:00","modifyTime":"2014-03-31 16:25:00","creator":"wxh","modifier":"wxh"}]');
